export default function instruments(){
    return [
        {
            id: 1,
            image: '/images/item.png',
            text: 'Локатор арматуры “Profoscope”'
        },
        {
            id: 2,
            image: '/images/inst-image-3.png',
            text: 'Измеритель прочности бетона “ОНИКС-1”'
        },
        {
            id: 3,
            image: '/images/item-3.png',
            text: 'Прибор ультразвукового действия “ПУЛЬСАР-2”'
        },
        {
            id: 4,
            image: '/images/item-4.png',
            text: 'Измеритель прочности бетона “Молоток Шмидта”'
        },
        {
            id: 5,
            image: '/images/item.png',
            text: 'Локатор арматуры “Profoscope”'
        },
    ]
}
